import React from 'react';
import './Header.css';
import logo from '../../assets/logo.svg';
import { Button } from '@material-ui/core';

const Header = function () {
    let accessToken = 'true'
    return (
        <div className="header">
            <span>
            <img src={logo} className='logo'></img>
            </span>
            <Button variant="contained" color='default' href='http://localhost:8085/v1/auth/login'>
                Login
            </Button>
            <Button variant="contained" color='default' disabled={accessToken} href='http://localhost:8085/v1/auth/login'>
                Login
            </Button>
        </div>
    )
}

export default Header;
